import './App.css';
import { Link } from "react-router-dom";

export default function App() {
  return (
    <div>
      <h1>Budget!</h1>
      <nav>
        <Link to="/invoices">Invoices</Link> |{" "}
        <Link to="/expenses">Expenses</Link>
      </nav>
    </div>
  );
}
